sys_variable_value.value:
(function execute(inputs, outputs) {

  var orderLineID = inputs.orderLineID;
  var accountSysID = inputs.accountSysID;
  var soID = inputs.soID;

  for (var i = 0; i < 3; i++) {
    if (i == 0) {
      var task = new GlideRecord('sn_ind_tmt_orm_order_task');
      task.initialize();
      task.order_line_item = orderLineID;
      task.account = accountSysID;
      task.parent = soID;
      task.short_description = "CPE License Assigned";
      task.state = 2;
      task.insert();
    } 
    if (i == 1) {
      var task = new GlideRecord('sn_ind_tmt_orm_order_task');
      task.initialize();
      task.order_line_item = orderLineID;
      task.account = accountSysID;
      task.parent = soID;
      task.short_description = "CPE Delivered";
      task.state = 2;
      task.insert();
    }
    if (i == 2) {
      var task = new GlideRecord('sn_ind_tmt_orm_order_task');
      task.initialize();
      task.order_line_item = orderLineID;
      task.account = accountSysID;
      task.parent = soID;
      task.short_description = "CPE Shipped";
      task.state = 2;
      task.insert();
    }
    if (i == 3) {
      var task = new GlideRecord('sn_ind_tmt_orm_order_task');
      task.initialize();
      task.order_line_item = orderLineID;
      task.account = accountSysID;
      task.parent = soID;
      task.short_description = "Activate claim license";
      task.state = 2;
      task.insert();
    }
  }
})(inputs, outputs);

